

CREATE TABLE `cases` (
  `OrderNumber` varchar(222) NOT NULL,
  `AccountNumber` varchar(222) NOT NULL,
  `TicketNumber` varchar(222) NOT NULL,
  `Title` varchar(222) NOT NULL,
  `CreatedOn` varchar(222) NOT NULL,
  `ModifiedOn` varchar(222) NOT NULL,
  `CaseType` varchar(222) NOT NULL,
  `Priority` varchar(222) NOT NULL,
  `FollowupBy` varchar(222) NOT NULL,
  `Owner` varchar(222) NOT NULL,
  `Status` varchar(222) NOT NULL,
  `CaseOrigin` varchar(222) NOT NULL,
  `CreatedBy` varchar(222) NOT NULL,
  `ModifiedBy` varchar(222) NOT NULL,
  `NoteText` text NOT NULL,
  `NoteCreatedBy` varchar(200) NOT NULL,
  `NoteCreatedDt` varchar(200) NOT NULL,
  `New_AccountInfoChangeOther` tinyint(1) NOT NULL,
  `New_ArrangedIncorrectly` tinyint(1) NOT NULL,
  `New_BadColor` tinyint(1) NOT NULL,
  `New_BadColor_Customer` tinyint(1) NOT NULL,
  `New_BadFile` tinyint(1) NOT NULL,
  `New_BillingAddressChange` tinyint(1) NOT NULL,
  `New_CYMKGrayscale` tinyint(1) NOT NULL,
  `New_CaseResolved` tinyint(1) NOT NULL,
  `New_CreditCardNumberChange` tinyint(1) NOT NULL,
  `New_CustomerMistakeOther` tinyint(1) NOT NULL,
  `New_FileRelatedOther` tinyint(1) NOT NULL,
  `New_IncorrectOrientation` tinyint(1) NOT NULL,
  `New_LowResolution` tinyint(1) NOT NULL,
  `New_LowResolution_customer` tinyint(1) NOT NULL,
  `New_NeedsRecanvasing` tinyint(1) NOT NULL,
  `New_NotJPG` tinyint(1) NOT NULL,
  `New_NotOnFTPSite` tinyint(1) NOT NULL,
  `New_ShippingAddressChange` tinyint(1) NOT NULL,
  `New_SizedIncorrectly` tinyint(1) NOT NULL,
  `New_TextBorderCroppedOff` tinyint(1) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;






CREATE TABLE `csv` (
  `id` int(20) NOT NULL auto_increment,
  `name` varchar(20) NOT NULL,
  `OwnerId` varchar(20) NOT NULL,
  `Date` varchar(20) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;






CREATE TABLE `registration` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(20) NOT NULL,
  `email` varchar(20) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `password` varchar(20) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;






CREATE TABLE `users` (
  `USER_ID` int(222) NOT NULL auto_increment,
  `USERNAME` varchar(222) NOT NULL,
  `PASSWORD` varchar(222) NOT NULL,
  `TIME_PASS` varchar(2222) NOT NULL,
  `TIME_PASS_ACTIVE` varchar(222) NOT NULL,
  `EMAIL_ADDRESS` varchar(222) NOT NULL,
  `ACTIVE` varchar(222) NOT NULL,
  `RANDOM_KEY` varchar(222) NOT NULL,
  `COMPANY_ID` varchar(222) NOT NULL,
  `CREATED_ON` varchar(222) NOT NULL,
  `CREATED_BY` varchar(222) NOT NULL,
  `MODIFIED_ON` varchar(2222) NOT NULL,
  `MODIFIED_BY` varchar(222) NOT NULL,
  PRIMARY KEY  (`USER_ID`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;




